    <<Bin2/binary, SubBin/binary>>.

e_field_m_vip_mcard_toc_fetch([Elem | Rest], Bin,
			      TrUserData) ->
    Bin2 = <<Bin/binary, 26>>,
    Bin3 =
	e_mfield_m_vip_mcard_toc_fetch('tr_encode_m_vip_mcard_toc.fetch[x]'(Elem,
									    TrUserData),
				       Bin2, TrUserData),
    e_field_m_vip_mcard_toc_fetch(Rest, Bin3, TrUserData);
e_field_m_vip_mcard_toc_fetch([], Bin, _TrUserData) ->
    Bin.

