decode_msg_m_vip_info_tos(Bin, TrUserData) ->
    dfp_read_field_def_m_vip_info_tos(Bin, 0, 0,
				      TrUserData).

dfp_read_field_def_m_vip_info_tos(<<>>, 0, 0, _) ->
    #m_vip_info_tos{};
dfp_read_field_def_m_vip_info_tos(Other, Z1, Z2,
				  TrUserData) ->
    dg_read_field_def_m_vip_info_tos(Other, Z1, Z2,
				     TrUserData).

dg_read_field_def_m_vip_info_tos(<<1:1, X:7,
				   Rest/binary>>,
				 N, Acc, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_m_vip_info_tos(Rest, N + 7,
				     X bsl N + Acc, TrUserData);
dg_read_field_def_m_vip_info_tos(<<0:1, X:7,
				   Rest/binary>>,
				 N, Acc, TrUserData) ->
    Key = X bsl N + Acc,
    case Key band 7 of
      0 -> skip_varint_m_vip_info_tos(Rest, 0, 0, TrUserData);
      1 -> skip_64_m_vip_info_tos(Rest, 0, 0, TrUserData);
      2 ->
	  skip_length_delimited_m_vip_info_tos(Rest, 0, 0,
					       TrUserData);
      3 ->
	  skip_group_m_vip_info_tos(Rest, Key bsr 3, 0,
				    TrUserData);
      5 -> skip_32_m_vip_info_tos(Rest, 0, 0, TrUserData)
    end;
dg_read_field_def_m_vip_info_tos(<<>>, 0, 0, _) ->
    #m_vip_info_tos{}.

skip_varint_m_vip_info_tos(<<1:1, _:7, Rest/binary>>,
			   Z1, Z2, TrUserData) ->
    skip_varint_m_vip_info_tos(Rest, Z1, Z2, TrUserData);
skip_varint_m_vip_info_tos(<<0:1, _:7, Rest/binary>>,
			   Z1, Z2, TrUserData) ->
    dfp_read_field_def_m_vip_info_tos(Rest, Z1, Z2,
				      TrUserData).

skip_length_delimited_m_vip_info_tos(<<1:1, X:7,
				       Rest/binary>>,
				     N, Acc, TrUserData)
    when N < 57 ->
    skip_length_delimited_m_vip_info_tos(Rest, N + 7,
					 X bsl N + Acc, TrUserData);
skip_length_delimited_m_vip_info_tos(<<0:1, X:7,
				       Rest/binary>>,
				     N, Acc, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_m_vip_info_tos(Rest2, 0, 0,
				      TrUserData).

skip_group_m_vip_info_tos(Bin, FNum, Z2, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_m_vip_info_tos(Rest, 0, Z2,
				      TrUserData).

skip_32_m_vip_info_tos(<<_:32, Rest/binary>>, Z1, Z2,
		       TrUserData) ->
    dfp_read_field_def_m_vip_info_tos(Rest, Z1, Z2,
				      TrUserData).

skip_64_m_vip_info_tos(<<_:64, Rest/binary>>, Z1, Z2,
		       TrUserData) ->
    dfp_read_field_def_m_vip_info_tos(Rest, Z1, Z2,
				      TrUserData).

decode_msg_m_vip_info_toc(Bin, TrUserData) ->
    dfp_read_field_def_m_vip_info_toc(Bin, 0, 0,
				      id(undefined, TrUserData),
				      id([], TrUserData),
				      id(undefined, TrUserData),
				      id(undefined, TrUserData), TrUserData).

dfp_read_field_def_m_vip_info_toc(<<8, Rest/binary>>,
				  Z1, Z2, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    d_field_m_vip_info_toc_daily_exp(Rest, Z1, Z2, F@_1,
				     F@_2, F@_3, F@_4, TrUserData);
dfp_read_field_def_m_vip_info_toc(<<18, Rest/binary>>,
				  Z1, Z2, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    d_pfield_m_vip_info_toc_lv_reward(Rest, Z1, Z2, F@_1,
				      F@_2, F@_3, F@_4, TrUserData);
dfp_read_field_def_m_vip_info_toc(<<16, Rest/binary>>,
				  Z1, Z2, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    d_field_m_vip_info_toc_lv_reward(Rest, Z1, Z2, F@_1,
				     F@_2, F@_3, F@_4, TrUserData);
dfp_read_field_def_m_vip_info_toc(<<24, Rest/binary>>,
				  Z1, Z2, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    d_field_m_vip_info_toc_weekly_gift(Rest, Z1, Z2, F@_1,
				       F@_2, F@_3, F@_4, TrUserData);
dfp_read_field_def_m_vip_info_toc(<<32, Rest/binary>>,
				  Z1, Z2, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    d_field_m_vip_info_toc_auto_fetch(Rest, Z1, Z2, F@_1,
				      F@_2, F@_3, F@_4, TrUserData);
dfp_read_field_def_m_vip_info_toc(<<>>, 0, 0, F@_1, R1,
				  F@_3, F@_4, TrUserData) ->
    #m_vip_info_toc{daily_exp = F@_1,
		    lv_reward = lists_reverse(R1, TrUserData),
		    weekly_gift = F@_3, auto_fetch = F@_4};
dfp_read_field_def_m_vip_info_toc(Other, Z1, Z2, F@_1,
				  F@_2, F@_3, F@_4, TrUserData) ->
    dg_read_field_def_m_vip_info_toc(Other, Z1, Z2, F@_1,
				     F@_2, F@_3, F@_4, TrUserData).

dg_read_field_def_m_vip_info_toc(<<1:1, X:7,
				   Rest/binary>>,
				 N, Acc, F@_1, F@_2, F@_3, F@_4, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_m_vip_info_toc(Rest, N + 7,
				     X bsl N + Acc, F@_1, F@_2, F@_3, F@_4,
				     TrUserData);
dg_read_field_def_m_vip_info_toc(<<0:1, X:7,
				   Rest/binary>>,
				 N, Acc, F@_1, F@_2, F@_3, F@_4, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_m_vip_info_toc_daily_exp(Rest, 0, 0, F@_1, F@_2,
					   F@_3, F@_4, TrUserData);
      18 ->
	  d_pfield_m_vip_info_toc_lv_reward(Rest, 0, 0, F@_1,
					    F@_2, F@_3, F@_4, TrUserData);
